import axios from "axios";
import { useEffect } from "react";
import styled from "styled-components";
import { tmdAxios } from "../../../api/tmdbAxios";
import ContentList from "../ContentList";

function Home() {
  useEffect(() => {
    const key = process.env.REACT_APPTMDB_API_KEY;
    tmdAxios.get(`/trending/all/day`).then((res) => console.log(res));
  }, []);

  console.log(process.env.REACT_APPTMDB_API_KEY);
  return (
    <Container>
      <ContentList title="트렌딩" />
      <ContentList title="What's Popular" />
      <ContentList title="Free to Watch" />
    </Container>
  );
}

const Container = styled.div`
  max-width: 900px;
  margin: 0 auto;
`;
export default Home;
